YAHOO.namespace("fisma.CheckboxTree");YAHOO.fisma.CheckboxTree.rootNode;YAHOO.fisma.CheckboxTree.handleClick=function(h,c){if(c.altKey){return}var g=h.parentNode;if(g.nextSibling){var a=h.getAttribute("nestedlevel");var d=new Array();var k=true;var b=g.nextSibling;var j=b.childNodes[0];while(j.getAttribute("nestedLevel")>a){if(!j.checked){k=false}d.push(j);if(b.nextSibling){b=b.nextSibling;j=b.childNodes[0]}else{break}}if(k){h.checked=false}else{h.checked=true}for(var e in d){var f=d[e];if(k){f.checked=false}else{f.checked=true}}}};